  false,\n\t\"url\": null,\n\t\"notes\": \"Separate data for floodplain elevation
  and bathymetry were collected on the Upper Mississippi River System (UMRS) by the
  US Army Corps of Engineers (USACE), Upper Mississippi River Restoration (UMRR) program.
  While many information needs can be met by using these data separately, in many
  cases seamless elevation data across the river and its floodplain are needed. This
  seamless elevation surface was generated by merging lidar (i.e., floodplain elevation)
  and bathymetry data. Merging the data required special processing in the areas of
  transition between the two sources of data.\",\n\t\"license_title\": null,\n\t\"extras\":
